import React, { Component } from 'react';
import ArrowBackIcon from '@material-ui/icons/ArrowBack';
import OpenInNewIcon from '@material-ui/icons/OpenInNew';
import { Grid } from '@material-ui/core';

import '../../../../css/fonts.css';
import { IconButton, MuiThemeProvider } from '@material-ui/core';
import {NavLink} from 'react-router-dom';
import {EventName} from '../../../themes/themes';
import {styles} from '../../components/ProjectName/styles/styles';

class ProjectName extends Component {
    state = {  }

    styles={
        blueBar:{
            background: "#7FD6D0",
            paddingBottom: 20
        },
        projFont:{
            height: 33,
            fontFamily: "'Open Sans', sans-serif",
            fontWeight: 700,
            fontSize: 24,
            color: "#FFFFFF",
            lineHeight: "24px"
        },
        NameFont:{
            height: 57,
            color: "#000000",
            lineHeight: "57px",
            fontWeight: 600,
            fontFamily: "'Open Sans', sans-serif",
            fontSize: 42
        },
        github:{
            height: 43,
            color: "#FFFFFF",
            fontWeight: 400,
            fontFamily: "'Open Sans', sans-serif",
            lineHeight: "43px",
            fontSize: 32
        },
    }
    
    render() { 
        return ( 
            <React.Fragment>
                <Grid
                style={this.styles.blueBar}
                container
                direction="row"
                justify="center"
                alignItems="flex-start"
                >
                    <Grid item style={{padding: "20px 40px 10px 40px"}} xs={12} >
                        <MuiThemeProvider theme={EventName}>
                            <IconButton color="primary" >
                            <NavLink to="/Projects" style={styles.Nlink}>
                                <ArrowBackIcon />
                            </NavLink>
                            </IconButton>
                            <span style={this.styles.projFont} >Projects</span>
                        </MuiThemeProvider>
                    </Grid>
                    <Grid item style={{padding: "20px 40px 20px 60px"}} xs={12} md={6} >
                        <span style={this.styles.NameFont} >
                            {this.props.title}
                        </span>
                    </Grid>
                    <Grid item style={{padding: "20px 40px 20px 60px"}} xs={12} md={6} >
                        <Grid
                        container
                        direction="row"
                        justify="flex-end"
                        alignItems="flex-start"
                        >
                            <Grid item >
                            <span style={this.styles.github} >Github</span>
                                <IconButton color="primary" >
                                    <a href={this.props.link} style={styles.Nlink}>
                                    <OpenInNewIcon />
                                    </a>
                                </IconButton>
                            </Grid>
                        </Grid>
                    </Grid>
                </Grid>
            </React.Fragment>
